          <h3>
            {title}
          </h3>
          <button type="button" className={done ? 'done' : ''} />
        </div>
        <p>
          {description}
        </p>
        <span>
          done: {done}
        </span>
      </div>
      <style jsx>
        {`
          .card {
            border: 1px solid #0000001A;
            border-radius: 7px;
            box-shadow: 3px 5px 10px #0000004D;
            padding: 10px;
            color: #0000008C;
          }
          .card-header {
            display: flex;
            justify-content: space-between;
          }
          h3 {
            margin-bottom: 5px;
          }
